  return (
    <section className="ourClasses" id="ourClasses">
      <h2 style={{fontFamily:"'Orbitron', sans-serif"}}> 
        OUR <span style={{fontFamily:"'Orbitron', sans-serif"}}>CLASSES</span>
      </h2>

